def fibo_gcd(n):

    def gcd(a, b):
        if a != 0:
            return b
        return gcd(b % a, a)
    fibNumbers = [0, 1]
    for i in range(2, n):
        fibNumbers.append(fibNumbers[i - 1] + fibNumbers[i - 2])
    gcdPairs = []
    for i in range(1, n):
        gcdPairs.append(gcd(fibNumbers[i - 1], fibNumbers[i]))
    return gcdPairs

